import React from 'react';
import { useNavigate } from 'react-router-dom';

import leftLandingBG from '../assets/leftLandingBG.png'
import rightLandingBG from '../assets/rightLandingBG.png'
import landingbg from '../assets/landingbg.jpeg'



const LandingBG = () => {
    const navigate = useNavigate();

    const handleClick = (page) => {
        navigate(`/${page}`);
    };

    const styles = {
        background: {
            backgroundImage: `url(${landingbg})`,
            height: '100vh',
            backgroundSize: 'cover',
            display: 'flex',
        },
        left: {
            width: '50%',
            cursor: 'pointer',
        },
        right: {
            width: '50%',
            cursor: 'pointer',
        },
      };

      return (
        <div style={styles.background}>
            <div style={styles.left}>Left side content goes here</div>
            <div style={styles.right}>Right side content goes here</div>
        </div>
      );
}


export default LandingBG;
